    "import cv2\n",
    "import numpy as np\n",
    "from sklearn.metrics.pairwise import cosine_similarity\n",
    "\n",
    "class num_one:\n",
    "  # 建構式(Constructor)\n",
    "  def __init__(self, num=0, value=0.0):\n",
    "    self.num = num  # 圖片號碼(Attribute)\n",
    "    self.value = value  # 相似度(Attribute)\n",
    "  # 方法(Method)\n",
    "  def info(self):\n",
    "    print(f'#1 number = \\\"{self.num}\\\" ,  sim_value = \\\"{self.value}\\\"')\n",
    "\n",
    "def image_to_vector(image):\n",
    "    # 将图片展平成一维向量\n",
    "    return image.flatten().reshape(1, -1)\n",
    "\n",
    "# 找一個test\n",
    "for i in range(select_num):\n",
    "\n",
    "  vector1 = image_to_vector(latent_vector_valid[i])\n",
    "  sim_store = []\n",
    "  target = num_one()\n",
    "  \n",
    "  for eva_num in range(sample_amount):\n",
    "      \n",
    "      # 将图片转换为向量\n",
    "      vector2 = image_to_vector(z_vec[eva_num])\n",
    "\n",
    "      # 计算余弦相似度\n",
    "      cos_sim = cosine_similarity(vector1, vector2)\n",
    "\n",
    "      if(cos_sim[0][0] >= target.value):\n",
    "          target.value = cos_sim[0][0]\n",
    "          target.num = eva_num\n",
    "\n",
    "      print('pic_num = ' + data_path + f'/{eva_num}.jpg')\n",
    "      print(f\"Cosine Similarity: {cos_sim[0][0]}\")\n",
    "      sim_store.append(float(cos_sim[0][0]))\n",
    "\n",
    "  target.info()\n",
    "\n",
    "  categories = list(range(1, sample_amount+1))\n",
    "  values = sim_store\n",
    "\n",
    "  fig, axs = plt.subplots(2, 1, figsize=(10, 15))\n",
    "\n",
    "  # 绘制条形图\n",
    "  axs[0].bar(categories, values)\n",
    "  axs[0].set_title('Bar Chart')\n",
    "  axs[1].plot(categories, values, marker='o', linestyle='-', color='b', label='Line 1')\n",
    "  axs[1].set_title('Line Chart')\n",
    "  # axs[1].legend()\n",
    "  axs[1].grid(True)\n",
    "\n",
    "  #圖片比較\n",
    "  fin_gen_path = os.path.join(gen_path, f'LINE_ALBUM_food_test_gen_240806_{rand_num[i]}.jpg')\n",
    "  fin_data_path = os.path.join(data_path, f'{target.num}.jpg')\n",
    "  print(fin_gen_path)\n",
    "  print(fin_data_path)\n",
    "  pic_gen = Image.open(fin_gen_path)\n",
    "  pic_data = Image.open(fin_data_path)\n",
    "\n",
    "  # 创建一个额外的子图以显示其他两张图片\n",
    "  fig, axs2 = plt.subplots(1, 2, figsize=(10, 5))\n",
    "  axs2[0].imshow(pic_gen)\n",
    "  axs2[0].axis('off')  # 关闭坐标轴\n",
    "  axs2[0].set_title('gen')\n",
    "  axs2[1].imshow(pic_data)\n",
    "  axs2[1].axis('off')  # 关闭坐标轴\n",
    "  axs2[1].set_title('data')\n",
    "\n",
    "  plt.show()\n",
